	constructor (props) {
		super(props);
		console.log("constructor", props);
	}

	allDays = (props) => {
		const content = props.data.map((day) =>
			<li>
				<div dayname={day.dt_text}
					 />
			</li>
		)
		console.log("content",content);
		return (
			<ul className="forecast">
				{content}  			
			</ul>
			)	
	}
	render() {
		return(<div>{this.allDays}</div>);
	};

}

export default Forecast;
